import React, { useState, useContext } from "react";

const Summary = ({ sessionInfo, sessionScore, newGame }) => {
  return (
    <div className="popup-container">
      <div className={"summary"}>
        <h1>SUMMARY</h1>
        <h3 id="score">Score: {sessionScore}</h3>
        <div className="summary-songs">
          {sessionInfo.map((guess) => {
            return <h3>{guess.country}</h3>;
            <iframe
              src={`https://open.spotify.com/embed/track/${guess.id}`}
              width="90%"
              height="380"
              frameborder="0"
              allowtransparency="true"
              allow="encrypted-media"
            ></iframe>;
          })}
        </div>
        <div className={"popup-buttons"}>
          <button onClick={newGame}>NEW GAME</button>
        </div>
      </div>
    </div>
  );
};

export default Summary;
